// Header.js

import React, { useState } from 'react';
import Modal from 'react-modal';
import LoginForm from './LoginForm';

const Header = () => {
    const [isLoginModalOpen, setIsLoginModalOpen] = useState(false);

    const openLoginModal = () => {
        setIsLoginModalOpen(true);
    };

    const closeLoginModal = () => {
        setIsLoginModalOpen(false);
    };

    return (
        <header className="header">
            <h1>Welcome to BargainHunter</h1>
            <nav className="nav">
                <ul>
                    <li><button onClick={() => console.log("Sell Items clicked")}>Sell Your Items</button></li>
                    <li><button onClick={() => console.log("Buy Items clicked")}>Buy Items</button></li>
                    <li><button onClick={() => console.log("List Home clicked")}>List Home</button></li>
                    <li><button onClick={() => console.log("Register clicked")}>Register</button></li>
                    <li><button onClick={openLoginModal}>Login</button></li>
                </ul>
            </nav>
            <Modal isOpen={isLoginModalOpen} onRequestClose={closeLoginModal}>
                <LoginForm onClose={closeLoginModal} />
            </Modal>
        </header>
    );
};

export default Header;
